import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const TouchableOpacity = styled.button`
    position: absolute;
    background-color: #38a69d;
    border-radius: 50px;
    padding: 8px;
    width: 60%;
    align-self: center;
    bottom: 15%;
    align-items: center;
    justify-content: center;
`;
